import React from 'react'
import { Helmet } from "react-helmet";
import logo from "../assets/icons/logo.svg"

function Home() {
  return (
    <>
        <Helmet>
            <title>Byway</title>
            <link rel="icon" href={logo}/>
        </Helmet>

    </>
  )
}

export default Home
